DROP TABLE IF EXISTS `purchase_order`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `purchase_order` (
  `folio_number` varchar(128) NOT NULL,
  `id_area` int(11) NOT NULL,
  `id_user` int(11) unsigned NOT NULL,
  `id_contract` int(11) NOT NULL,
  `id_payment_condition` int(11) DEFAULT NULL,
  `id_payment_method` int(11) DEFAULT NULL,
  `contract_number` varchar(128) DEFAULT NULL,
  `quotation_number` varchar(128) DEFAULT NULL,
  `total_price` decimal(18,2) DEFAULT NULL,
  `total_iva_price` decimal(18,2) DEFAULT NULL,
  `id_currency` int(11) DEFAULT NULL,
  `is_visible` int(11) DEFAULT '1',
  `date_purchase` datetime DEFAULT NULL,
  `order_state` varchar(40) DEFAULT NULL,
  `exchange_rate` decimal(18,2) DEFAULT '1.00',
  `old_folio_number` varchar(128) DEFAULT NULL,
  `paid_type` int(11) DEFAULT NULL,
  PRIMARY KEY (`folio_number`),
  KEY `id_area` (`id_area`),
  KEY `id_contract` (`id_contract`),
  KEY `id_currency` (`id_currency`),
  KEY `id_payment_condition` (`id_payment_condition`),
  KEY `id_payment_method` (`id_payment_method`),
  KEY `id_user` (`id_user`),
  CONSTRAINT `purchase_order_ibfk_1` FOREIGN KEY (`id_area`) REFERENCES `areas` (`id_area`),
  CONSTRAINT `purchase_order_ibfk_2` FOREIGN KEY (`id_user`) REFERENCES `users` (`id_user`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `purchase_order_ibfk_3` FOREIGN KEY (`id_contract`) REFERENCES `contract` (`id_contract`),
  CONSTRAINT `purchase_order_ibfk_4` FOREIGN KEY (`id_currency`) REFERENCES `currency` (`id_currency`),
  CONSTRAINT `purchase_order_ibfk_5` FOREIGN KEY (`id_payment_condition`) REFERENCES `payment_conditions` (`id_payment_conditions`),
  CONSTRAINT `purchase_order_ibfk_6` FOREIGN KEY (`id_payment_method`) REFERENCES `payment_method` (`id_payment_method`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;
/*!40101 SET character_set_client = @saved_cs_client */;

